    }

    redirect = () => {
        if (this.state.login === true) {
            return 
        }
    }

    login = () => {
        this.redirect()
    }

    render () {
        return(
            <div>
                <form>
                    <input 
                        className = "input"
                        id = "username"
                        placeholder = "Username"
